pragma solidity ^0.4.18;
contract LandTransfers {

    struct landTransferInfo{
        uint32 buyer_id;
        uint32 seller_id;
        uint32 lat;
        uint32 lon;
        bool init;
    }

    // an array which holds all the current ids of userRecords, can iterate and find all users with this array
    uint32[] PIN_hash_array;

    // Every land parcel is uniquely identified by a PIN_hash
    mapping(uint32 => landTransferInfo) landTransfers;

    function returnContractAddress () public view returns (address) {
        return address(this);
    }

    function getPIN (uint index) public view returns (uint32) {
        return PIN_hash_array[index];
    }

    function getNumLandTransfers () public view returns (uint) {
        return PIN_hash_array.length;
    }

    function createLandTransfer (uint32 _PIN, uint32 _buyer_id, uint32 _lat, uint32 _lon) public returns (bool) {
        var newLandTransfer = landTransfers[_PIN];
        newLandTransfer.buyer_id = _buyer_id;
        newLandTransfer.lat = _lat;
        newLandTransfer.lon = _lon;
        newLandTransfer.init = true;
        PIN_hash_array.push(_PIN);
    }

    function getLandTransfer (uint32 _PIN) public view returns (uint32, uint32, uint32) {
        var landTransferRecord = landTransfers[_PIN];
        return (landTransferRecord.buyer_id, landTransferRecord.lat, landTransferRecord.lon);
    }
 }
